<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="utf-8">
    <meta http-equiv="Content-Type" content="text/html; charset=utf-8">
    <title>Horror Tale</title>
    <style>
        html, body {
            margin: 0;
            padding: 0;
            width: 100%;
            height: 100%;
            overflow: hidden;
            background: #000;
            color: #fff;
            font-family: sans-serif;
            display: flex;
            align-items: center;
            justify-content: center;
        }
        #unity-container {
            position: fixed;
            inset: 0;
            display: none;
        }
        #unity-canvas {
            position: fixed;
            inset: 0;
            width: 100%;
            height: 100%;
            display: none;
            background: #000;
        }
        #status {
            width: 250px;
            text-align: center;
        }
        .bar-bg {
            width: 100%;
            height: 2px;
            margin-top: 15px;
            border-radius: 10px;
            overflow: hidden;
            background: #1a1a1a;
        }
        #bar {
            width: 0%;
            height: 100%;
            background: #fff;
            transition: width 0.4s ease;
        }
        #msg {
            font-size: 10px;
            letter-spacing: 2px;
            text-transform: uppercase;
            opacity: 0.6;
        }
    </style>
</head>

        <div class="bar-bg"><div id="bar"></div></div>

    <div id="unity-container">
